  Minnesota at a 50 meter height.rnrnThis data set has been validated by NREL and
  wind energy meteorological consultants. *Note:* This data is not suitable for micro-siting
  potential development projects.   rnrn###Original datarnData from [Minnesota state
  portal](http://mn.gov/portal/search/?query=wind+resource). The 30m and 80m wind
  speed values were averaged, then converted to power density assuming a Weibull K
  of 2.0 and using elevation to estimate air density.rnrnrnThis map has been validated
  with available surface data by NREL and wind energy meteorological consultants.\",\n\t\"license_title\":
